@php
	if(!function_exists('describe')) {
		/**
	 	 * @param  int    $bytes
	 	 * @return string
	 	*/
		function describe(int $bytes) : string
		{
   			if ($bytes < 1024) {
      			return $bytes . 'B';
   			} elseif ($bytes < 1048576) {
      			return round($bytes / 1024, 2) . 'KB';
    		}

		   	return round($bytes / 1048576, 2) . 'MB';
		}
	}

	$theme = $config->theme;
	if($config->theme == '') {
		$theme = 'light';
	}
